```go
package main

import "fmt"

func main() {
	// Declare a slice of strings.
	// A slice is a dynamically-sized, flexible view into an array.
	// It does not store data itself, but rather points to an underlying array.
	names := []string{"Alice", "Bob", "Charlie"}

	// Access elements by index.
	fmt.Println("First name:", names[0]) // Output: Alice

	// Get a slice of the first two elements.
	// Slicing creates a new slice that points to the same underlying array.
	firstTwo := names[:2]
	fmt.Println("First two:", firstTwo) // Output: [Alice Bob]

	// Modify an element in the original slice.
	names[1] = "David"
	fmt.Println("Modified names:", names) // Output: [Alice David Charlie]

	// The changes are reflected in the slice created earlier.
	fmt.Println("First two (after modification):", firstTwo) // Output: [Alice David]

	// Append elements to the slice.
	// Appending might create a new underlying array if the capacity is insufficient.
	names = append(names, "Eve")
	fmt.Println("Appended names:", names) // Output: [Alice David Charlie Eve]

	// Get the length and capacity of the slice.
	fmt.Println("Length:", len(names)) // Output: 4
	fmt.Println("Capacity:", cap(names)) // Output: Might vary depending on the implementation

	// Create an empty slice with a predefined capacity.
	numbers := make([]int, 0, 5) // Length: 0, Capacity: 5
	fmt.Println("Empty numbers:", numbers) // Output: []
}
