5. **limitChunkMatches**: This function limits the number of chunk matches in a `FileMatch` object and returns the remaining limit.

6. **limitLineMatches**: This function limits the number of line matches in a `FileMatch` object and returns the remaining limit.

The code ensures that the number of documents and matches returned in search results does not exceed the specified limits, which helps in managing the performance and resource usage of the search engine.

