	git, err := git.New(cfg.Git)
	if err != nil {
		return nil, fmt.Errorf("failed to create git client: %w", err)
	}
	indexer, err := index.New(cfg.Index, log)
	if err != nil {
		return nil, fmt.Errorf("failed to create indexer: %w", err)
	}
