Goroutines are a fundamental feature of Go (Golang) that enable concurrent programming. They are lightweight threads managed by the Go runtime, rather than operating system threads. Here's an overview of how goroutines work:

1. Lightweight: 
Goroutines are extremely lightweight compared to traditional threads. They typically use only a few kilobytes of stack space and can be created and destroyed inexpensively.

2. Multiplexing:
The Go runtime multiplexes goroutines onto a smaller number of OS threads. This means many goroutines can run on the same OS thread, switching rapidly between them.

3. Creation:
You can start a goroutine by using the `go` keyword followed by a function call:

```go:main.go
func main() {
    go someFunction()
    // Main continues executing immediately
}

func someFunction() {
    // This runs concurrently
}
```

4. Scheduling:
The Go runtime includes a scheduler that manages goroutines. It decides which goroutines should run and when they should be paused or resumed.

5. Communication:
Goroutines communicate through channels, which provide a way for goroutines to send and receive values:

```go:main.go
func main() {
    ch := make(chan int)
    go sendNumber(ch)
    num := <-ch
    fmt.Println("Received:", num)
}

func sendNumber(ch chan int) {
    ch <- 42
}
```

6. Concurrency vs Parallelism:
Goroutines enable concurrency, which is the composition of independently executing processes. Parallelism (simultaneous execution) may occur if the underlying system has multiple CPU cores and the Go runtime decides to distribute goroutines across them.

7. Synchronization:
The `sync` package provides primitives like mutexes and wait groups for synchronizing goroutines when necessary.

8. Stack Management:
Goroutines start with a small stack (often just 2KB) that can grow and shrink as needed, allowing efficient memory usage.

9. Error Handling:
Each goroutine is responsible for its own error handling. Panics in a goroutine will only affect that goroutine unless they're recovered.

10. Termination:
Goroutines exit when their function returns. The main goroutine's exit will terminate the program, even if other goroutines are still running.

Here's a simple example demonstrating goroutines and channels:

```go:main.go
package main

import (
    "fmt"
    "time"
)

func worker(id int, jobs <-chan int, results chan<- int) {
    for j := range jobs {
        fmt.Printf("Worker %d started job %d\n", id, j)
        time.Sleep(time.Second)
        fmt.Printf("Worker %d finished job %d\n", id, j)
        results <- j * 2
    }
}

func main() {
    jobs := make(chan int, 100)
    results := make(chan int, 100)

    // Start 3 worker goroutines
    for w := 1; w <= 3; w++ {
        go worker(w, jobs, results)
    }

    // Send 5 jobs
    for j := 1; j <= 5; j++ {
        jobs <- j
    }
    close(jobs)

    // Collect results
    for a := 1; a <= 5; a++ {
        <-results
    }
}
```

This example demonstrates how goroutines can be used to create a simple worker pool, showcasing concurrent execution and communication through channels.

