This file contains functions to limit the number of file matches, chunk matches, and line matches returned from a search query based on configured limits. 

The `SortAndTruncateFiles` function sorts the file matches and then truncates them using a `DisplayTruncator` based on the search options.

The `NewDisplayTruncator` function returns a `DisplayTruncator` closure that enforces the document and match display limits specified in the search options. If no limits are set, it returns a no-op function.

The `limitMatches` function applies either `limitChunkMatches` or `limitLineMatches` to each file match, depending on the `chunkMatches` flag, until the limit is exhausted.

The `limitChunkMatches` function truncates the `Ranges`, `SymbolInfo`, and `Content` fields of each chunk match in a file match to the specified limit. It handles multiline ranges and context lines correctly.

The `limitLineMatches` function simply truncates the `LineFragments` field of each line match in a file match to the specified limit.

Overall, this file provides functionality to limit the amount of data returned from a search query, which can be useful for performance and UI considerations.

