Here's an overview of the logic in `src/agent.go` related to how agents interact with ranking:

1. The `Agent` struct represents a search agent that handles searching a specific shard of the indexed data.

2. When a search query is received, the `Agent.Search` method is called, which performs the following steps:

   a. It calls `agent.loadRankers()` to load the ranking functions for the shard.
   b. It calls `agent.searchMaster()` to perform the actual search on the shard's data.
   c. The search results are passed through the loaded ranking functions via `agent.rank(...)`.

3. The `loadRankers()` method loads the ranking functions based on the configured ranking options:

```go:src/agent.go
func (agent *Agent) loadRankers() error {
	agent.rankers = make([]zoekt.Ranker, 0, len(agent.opts.RankOptions))
	for _, o := range agent.opts.RankOptions {
		r, err := zoekt.GetRanker(o)
		if err != nil {
			return err
		}
		agent.rankers = append(agent.rankers, r)
	}
	return nil
}
```

4. The `rank(...)` method applies the loaded ranking functions to the search results:

```go:src/agent.go
func (agent *Agent) rank(ctx context.Context, results []zoekt.SearchResult) ([]zoekt.SearchResult, error) {
	for _, r := range agent.rankers {
		var err error
		results, err = r.RankResults(ctx, agent.opts.Stats, results)
		if err != nil {
			return nil, err
		}
	}
	return results, nil
}
```

So in summary, the agents load the configured ranking functions and apply them to the search results before returning them. The ranking functions can use various factors like file content, file path, repository information, etc. to score and rank the results.

Goroutines are lightweight threads of execution in Go that are managed by the Go runtime. They work by leveraging the concept of concurrent programming, which allows multiple tasks to make progress simultaneously. Here's a high-level overview of how goroutines work:

1. **Creation**: Goroutines are created by calling the `go` keyword followed by a function call. This function call is executed concurrently with the current goroutine. For example:

```go:main.go
func main() {
    go doSomeWork() // creates a new goroutine
    // main goroutine continues execution
}

func doSomeWork() {
    // code to be executed concurrently
}
```

2. **Scheduling**: The Go runtime manages the scheduling of goroutines onto the available logical processors (or threads). It uses a technique called "work stealing" to efficiently distribute the workload across available processors.

3. **Context Switching**: When a goroutine is blocked (e.g., waiting for I/O or a channel operation), the Go runtime can switch to another goroutine, allowing other goroutines to make progress. This context switching is lightweight and efficient compared to traditional thread context switching.

4. **Communication**: Goroutines communicate via channels, which are typed conduits through which values can be sent and received. Channels provide synchronization and data exchange between goroutines, allowing them to coordinate their work.

5. **Synchronization**: Go provides various synchronization primitives, such as channels, mutexes, and wait groups, to coordinate the execution of goroutines and manage shared resources safely.

6. **Memory Management**: Goroutines share the same address space, but each goroutine has its own stack. The Go runtime manages the allocation and deallocation of goroutine stacks efficiently, growing and shrinking them as needed.

7. **Concurrency Safety**: Go's design and language features, such as goroutine scheduling, channels, and memory safety, help prevent common concurrency issues like race conditions and deadlocks.

Goroutines are lightweight and efficient, allowing Go programs to handle thousands or even millions of concurrent tasks with minimal overhead. This concurrency model, combined with channels for communication and synchronization, makes Go well-suited for building scalable and efficient concurrent systems.

